import React from 'react'
import ReactDOM from 'react-dom'

const Song = ({num, link}) => {
  return (
    <>
      <h1>
        Song {num}
      </h1>
      <iframe title = "pog" src={link} width="300" height="80" frameborder="0" allowtransparency="true" allow="encrypted-media"></iframe>
      <br/>
      <button>pog</button>

    </>
  )
}

const App = () => {
  console.log('Hello from component')
  return (
    <div>
      <div class="container">
        <div class="fixed">
          <Song link="https://open.spotify.com/embed/track/1UGD3lW3tDmgZfAVDh6w7r" num = "1"/>
        </div>
        <div class="g">
          <Song link="https://open.spotify.com/embed/track/1UGD3lW3tDmgZfAVDh6w7r" num = "2"/>
        </div>
      </div>
    </div>
  )
}

ReactDOM.render(<App />, document.getElementById('root'))
